     "type": "integer"
    },
    "poolMinSize": {
     "description": "The minimal size of the connection pool.",
     "type": "integer"
    },
    "port": {
     "description": "Sets the port of the default JDBC URL of the chosen vendor. If the `url` option is set, this option is ignored.",
     "type": "integer"
